import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header>
        <nav>
            <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/bookmarks">Bookmarks</Link></li>
            <li><Link to="/settings">Settings</Link></li>
            </ul>
        </nav>
    </header>
    );
};

export default Header;
